// Category-menu mobile
// --------------------------

(function () {
    var categoryMenu = document.querySelector('.nav-category__list-js');
    var categoryMenuItem = categoryMenu.querySelectorAll('.nav-category__item');

    var dropDown = Array.from(categoryMenuItem);

    var handlerClick = function handlerClick(e) {
        e.preventDefault();

        if (e.currentTarget.classList.contains('active')) {
            e.currentTarget.classList.remove('active');
        } else {

            dropDown.forEach(function (node) {
                node.classList.remove('active');
            });

            e.currentTarget.classList.add('active');
        }
    };

    dropDown.forEach(function (node) {
        node.addEventListener('click', handlerClick);
    });
})();

// Sign-in form
// --------------------------

(function () {
    var signInBtn = document.querySelector('.sign-in-js');
    var signInForm = document.querySelector('.sign-in__form-wrap-js');
    var headerTop = document.querySelector('.header-top-wrap');

    signInBtn.addEventListener('click', function () {
        headerTop.classList.toggle('open');
    });

    window.addEventListener('click', function (event) {
        if (!signInForm.contains(event.target) && !signInBtn.contains(event.target)) {
            headerTop.classList.remove('open');
        }
    });
})();

// Sign-in/forgot form switch
// --------------------------

(function () {
    var switchBtn = document.querySelector('.forgot-password-js');
    var switchBtnBack = document.querySelector('.forgot-password-back-js');
    var signInForm = document.querySelector('.sign-in__form-hide-js');
    var forgotForm = document.querySelector('.forgot-password__form-hide-js');

    switchBtn.addEventListener('click', function () {
        signInForm.style.display = 'none';
        forgotForm.style.display = 'block';
    });

    switchBtnBack.addEventListener('click', function () {
        forgotForm.style.display = 'none';
        signInForm.style.display = 'block';
    });
})();


// Show more/less
// --------------------------

(function () {
    var showMoreLess = document.querySelector('.articles-more-less-js');

    if (showMoreLess) {
        showMoreLess.addEventListener('click', function () {
            showMoreLess.classList.toggle('more');
        });
    }
})();

// Show all
// --------------------------

(function () {
    var showAllSection = document.querySelector('.side-bar__content-js');

    var showMoreLess = document.querySelector('.articles-all-js');

    if (showMoreLess && showAllSection) {
        showMoreLess.addEventListener('click', function () {
            showMoreLess.classList.toggle('more');
            showAllSection.classList.toggle('show-all');
        });
    }
})();

// Range slider
// --------------------------

$(document).on('ready', function () {

    $('.uislide').slider({
        min: 0,
        max: 100,
        values: [0, 100],
        step: 1,
        range: true,
        slide: function (event, ui) {
            $('.uislide').prev().val(ui.values[0]);
            $('.uislide').next().val(ui.values[1]);

            var offset1 = $('.ui-slider-handle:eq(0)').offset();
            var offset2 = $('.ui-slider-handle:eq(1)').offset();
            $('.uislide').prev().css({'left': offset1.left - 7});
            $('.uislide').next().css({'left': offset2.left - 7});

        },

        start: function (event, ui) {
            var offset1 = $('.ui-slider-handle:eq(0)').offset();
            var offset2 = $('.ui-slider-handle:eq(1)').offset();
            $('.uislide').prev().css({'position': 'relative'});
            $('.uislide').next().css({'position': 'relative'});
            $('.uislide').prev().animate({'left': offset1.left - "7"}, 100);
            $('.uislide').next().animate({'left': offset2.left - "7"}, 100);
        },

        stop: function (event, ui) {
            var offset1 = $('.ui-slider-handle:eq(0)').eq(0).offset();
            var offset2 = $('.ui-slider-handle:eq(1)').eq(1).offset();

            $('.uislide').prev().css({'position': 'relative'});
            $('.uislide').next().css({'position': 'relative'});
            $('.uislide').prev().animate({'left': 0}, 100);
            $('.uislide').next().animate({'left': 0}, 100);
        }
    });
});

// Scroll up/down
// --------------------------

$(function () {

    var top = '.up-js',
        bottom = '.down-js';

    $(top).click(function () {
        $('html, body').animate({scrollTop: 0}, 1000);
        return false;
    });

    $(bottom).click(function () {
        $('html,body').animate({scrollTop: $(document).height()}, 1000);
        return false;
    });
});

// Show/hide filter
// --------------------------

(function () {
    var showHideBtn = document.querySelectorAll('.filter-show-hide-js');
    var dropDownFilter = Array.from(showHideBtn);

    var handlerClickFilter = function handlerClick(e) {
        e.preventDefault();

        if (showHideBtn) {
            e.currentTarget.closest('.field-group').classList.toggle('show');
        }
    };

    dropDownFilter.forEach(function (node) {
        node.addEventListener('click', handlerClickFilter);
    });
})();

// Add class for fast-view modal
// --------------------------

document.addEventListener("DOMContentLoaded", function () {
    (function () {
        var fullScreenBtn = document.querySelector('.rsFullscreenBtn');
        var fullScreenClass = 'full-screen';
        var modalFastView = document.querySelector('.modal--fast-view');

        if (fullScreenBtn) {
            fullScreenBtn.addEventListener('click', function () {
                if (modalFastView.classList.contains(fullScreenClass)) {
                    fullScreenBtn.closest('.modal--fast-view').classList.remove(fullScreenClass);
                } else {
                    fullScreenBtn.closest('.modal--fast-view').classList.add(fullScreenClass);
                }
            });
        }
    })();
});
